import './Listcard1.css'
function Listcard1(props){
    let player = props.data
    return(
        <div className='listcard_item'>
            <div className='listcard_item_sl_no'>{player.pos}</div>
            <LitscardItem p = {player}/>
        </div>
    );
}

export default Listcard1
